const ReservedTravel = ({ travelID, flight_ids, usedCompanies, visitedPlanets, flightDistance, flightDurationDays, flightCost, passengerFirstName, passengerLastName }) => {
    return (
        <div>
            <h1>Reserved Travel Details</h1>
            <p><strong>Travel ID:</strong> {travelID}</p>
            <p><strong>Flight IDs:</strong> {flight_ids ? flight_ids.join(', ') : 'N/A'}</p>
            <p><strong>Used Companies:</strong> {usedCompanies ? usedCompanies.join(', ') : 'N/A'}</p>
            <p><strong>Visited Planets:</strong> {visitedPlanets ? visitedPlanets.join(', ') : 'N/A'}</p>
            <p><strong>Flight Distance:</strong> {flightDistance} km</p>
            <p><strong>Flight Duration (Days):</strong> {flightDurationDays}</p>
            <p><strong>Flight Cost:</strong> ${flightCost}</p>
            <p><strong>Passenger Name:</strong> {passengerFirstName} {passengerLastName}</p>
        </div>
    );
};

export default ReservedTravel;
